import React from 'react';
import { Form, FormGroup, Input, Button } from 'reactstrap'
import TodoForm from '../components/TodoForm';

type State = {
  subject: string,
  todo_item: string,
}

interface IUpdateAppointmentProps {
  subject: string,
  todo_item: string,
}


class UpdateTodo extends React.Component<IUpdateAppointmentProps, State> {
    constructor(props: any) {
        super(props);
    }




    handleSubmit = (event: any) => {
        event.preventDefault();
        const { subject="", todo_item="" } = this.state;
        const Todo = {
          subject,
          todo_item,
        };
        console.log(Todo);
    };


    GetAppointments = () => {
        fetch('http://localhost:3000/todo', {
            method: 'GET',
            body: JSON.stringify({
                appointments: {
                    client_name: this.state.client_name,
                    phone_number: this.state.phone_number,
                    startDateTime: this.state.startDateTime,
                    note: this.state.note,
                },
            }),
            headers: new Headers({
                'Content-Type': 'application/json',
                Authorization: `Bearer ${localStorage.getItem('token')}`,
            }),
        })
            .then((response) => response.json())
            .then((data) => {
                console.log(data);
            });
    };

    render() {
        return (
            <div>
                <h1>Appointment Page</h1>
                <AppointmentForm client_name="MadMarcus" phone_number="" startDateTime="" note="" />
                <Form>
                    <FormGroup>
                        <Input
                            type="text"
                            placeholder="Client Name"
                            onChange={(e) => this.setState({ client_name: e.target.value })}
                            value={this.state.client_name}
                        />
                    </FormGroup>
                    <FormGroup>
                        <Input
                            type="text"
                            placeholder="Phone Number"
                            onChange={(e) => this.setState({ phone_number: e.target.value })}
                            value={this.state.phone_number}
                        />
                    </FormGroup>
                    <FormGroup>
                        <Input
                            type="text"
                            placeholder="Start Date and Time"
                            onChange={(e) => this.setState({ startDateTime: e.target.value })}
                            value={this.state.startDateTime}
                        />
                    </FormGroup>
                    <FormGroup>
                        <Input
                            type="text"
                            placeholder="Note"
                            onChange={(e) => this.setState({ note: e.target.value })}
                            value={this.state.note}
                        />
                    </FormGroup>
                </Form>
            </div>
        );
    }
};




export default UpdateAppointment;
